import React from 'react';
import PopupWithForm from './PopupWithForm';

function DeletePlacePopup ({isOpen, onClose, onDeletePlace}) {

  function handleSubmit(e) {
    e.preventDefault();
    onDeletePlace();
  }

  return (
    <PopupWithForm
      name='delete-card'
      title='Вы уверены?'
      buttonText='Да'
      isOpen={isOpen}
      onClose={onClose}
      onSubmit={handleSubmit}
    >
    </PopupWithForm>
  )
}

export default DeletePlacePopup;
